let propertyDetail = {
  id: '',
  title: '',
  notes: '',
  city: '',
  squareMeter: '',
  rooms: '',
  bathrooms: '',
  locationUrl: '',
  mainFeatures: '',
  equipmentIds: '',
  price: '',
  mainImage: '',
  images: '',
};

/* const loadProperty = getPropertyDetail(params.id).then((detail) => {
